    false,nt"url": null,nt"notes": "This narrative report for Kenai National
    Wildlife Refuge summarizes refuge activities from September through December of
    1949. The report begins with general information about weather conditions and fires
    on the refuge.  Wildlife- including migratory birds, upland game birds, big game
    animals, and fur animals- is also covered.  The report includes a refuge development
    section which discusses physical developments on the refuge.  Economic uses of the
    refuge are outlined; fur harvest and timber removal were the only uses during this
    period.  A progress report on field investigations is included.  The public relations
    section of the report discusses recreational uses of the refuge, refuge visitors,
    refuge participation, hunting, and enforcement.  N-R forms are provided at the end
    of the report.",nt"license_title": "License Not Specified",nt"extras":
